import React, { useState } from "react";
import "./TryMeal.css";

export default function TryMeal() {
  const [formData, setFormData] = useState({
    name: "",
    phone: "",
    email: "",
    address: ""
  });

  const [formSubmitted, setFormSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate form
    if (!formData.name || !formData.phone) {
      // Show error state
      return;
    }

    // Form submission would go here
    setFormSubmitted(true);

    // Reset form after submission
    setTimeout(() => {
      setFormData({
        name: "",
        phone: "",
        email: "",
        address: ""
      });
      setFormSubmitted(false);
    }, 3000);
  };

  return (
    <section className="try-meal-section section-fade" id="try-meal">
      <div className="container">
        <div className="section-title">
          <h2>Try Your First Meal</h2>
          <p>Experience the convenience of delicious, home-style meals</p>
        </div>

        <div className="try-meal-container">
          <div className="try-meal-image">
            <img src="https://images.unsplash.com/photo-1564671165093-20688ff1fffa?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1470&q=80" alt="Delicious meal" loading="lazy" />
            <div className="overlay-text">
              <span className="satisfaction-badge">First Meal Guarantee</span>
            </div>
          </div>

          <div className="try-meal-content">
            <h3>Experience Our Quality</h3>
            <p>Try our service with no long-term commitment. We're confident you'll love our meals, but if you're not completely satisfied, just let us know and we'll make it right.</p>

            <div className="guarantee-list">
              <div className="guarantee-item">
                <div className="guarantee-icon">
                  <i className="fas fa-clock"></i>
                </div>
                <div className="guarantee-text">
                  <h4>On-Time Delivery</h4>
                  <p>Your meals will arrive within the scheduled delivery window, or we'll compensate you.</p>
                </div>
              </div>

              <div className="guarantee-item">
                <div className="guarantee-icon">
                  <i className="fas fa-temperature-low"></i>
                </div>
                <div className="guarantee-text">
                  <h4>Hot & Fresh</h4>
                  <p>All meals are freshly prepared and delivered at the right temperature.</p>
                </div>
              </div>

              <div className="guarantee-item">
                <div className="guarantee-icon">
                  <i className="fas fa-leaf"></i>
                </div>
                <div className="guarantee-text">
                  <h4>Quality Ingredients</h4>
                  <p>We use only high-quality ingredients to ensure the best taste and nutrition.</p>
                </div>
              </div>
            </div>

            {formSubmitted ? (
              <div className="success-message">
                <div className="success-icon">
                  <i className="fas fa-check-circle"></i>
                </div>
                <h4>Request Submitted!</h4>
                <p>We'll contact you soon about your free meal.</p>
              </div>
            ) : (
              <form className="try-meal-form" onSubmit={handleSubmit}>
                <div className="form-group">
                  <label htmlFor="name">Full Name *</label>
                  <input 
                    type="text" 
                    id="name" 
                    name="name" 
                    value={formData.name}
                    onChange={handleChange}
                    placeholder="Your full name"
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="phone">Phone Number *</label>
                  <input 
                    type="tel" 
                    id="phone" 
                    name="phone" 
                    value={formData.phone}
                    onChange={handleChange}
                    placeholder="Your phone number"
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="email">Email Address</label>
                  <input 
                    type="email" 
                    id="email" 
                    name="email" 
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Your email address"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="address">Delivery Address</label>
                  <textarea 
                    id="address" 
                    name="address" 
                    value={formData.address}
                    onChange={handleChange}
                    rows={3} 
                    placeholder="Your delivery address"
                  />
                </div>

                <button type="submit" className="submit-button">
                  Get Your Trial Meal
                </button>

                <p className="form-disclaimer">By submitting, you agree to our Terms of Service and Privacy Policy.</p>
              </form>
            )}
          </div>
        </div>
      </div>
    </section>
  );
}
